$(document).ready(function(){
    $('.player .player-menu').click(function() {
        $(this).toggleClass('opened');
        $('.player .play-list').toggleClass('opened');
        $('.player .name').toggleClass('none');
        $('.player .scale').toggleClass('opened');
    });
    $('.js-burger').click(function () {
        $('.header').toggleClass('menu-opened');
    });
    if ( $('.main-slider') ) {
        $('.main-slider').bxSlider({
            nextText:'',
            prevText:'',
            mode: 'horizontal',
            responsive: true,
            pager: true,
            easing: 'jswing',
            adaptiveHeight: true,
            touchEnabled: true
        });
    }
    if ( $('.news-photo_slider') ) {
        $('.news-photo_slider').bxSlider({
            nextText:'',
            prevText:'',
            mode: 'horizontal',
            responsive: true,
            pager: true,
            easing: 'jswing',
            adaptiveHeight: true,
            touchEnabled: true
        });
    }
    $('.jsPopupClose').click(function () {
       $('.jsPopup').remove(); 
    });
});